export default function Create()
{
  return
  (
    <form>
      <input type="title" placeholder={'Title'}/>
      <input type="summary" placeholder={'summary'}/>
      <input type="file"/>
      <textarea name="" id="" cols="30" rows="10" ></textarea>
    </form>
  );
}
